import ReactDOM from "react-dom";
import ProfileUndergradAll from './ProfileUndergrad/ProfileUndergradAll'
import ProfileHeader from './ProfileHeader'


const Create = () =>  {

    const [page, setPage] = useState(0);

    const componentList = [
        <ProfileUndergradAll 
        page={page}
        setPage={setPage}
        />
    ]

    return(
        <>
            <ProfileHeader/>
            {componentList[page]}
        </>
    )
}

export default Create;
